import React from 'react';
import styled from 'styled-components';

const Body = () => {
    return (
        <BodyStyle>
        <Header />
        <Aside />
        <Articles />
        <Footer />
        </BodyStyle>
    )
}

export default Body;

const BodyStyle = styled.div`

    border: 0.5px solid red;    
    margin-left: auto;
    margin-right: auto;
    max-width: 42rem;
    padding: 2.625rem 1.3125rem;
`;
